import axios from 'axios'

class UserService{

    signup_service(data){
        return axios.post(+"signupjwt/",data)
    }


    login_service(data){
        return axios.post(+"user_login/", data)
    }

    forgotPassword_service(data){
        return axios.post(+"forgot_password/",data)
    }



}
export default UserService;
